//GOOGLE SITEMAP
var geocoder;
var map = new Array();


var mapCenterOffsetX = 0;
var mapCenterOffsetY = 0;
var mapMarkers = [];

function initialize_Map(map_id, markers, zoom, styles,  xOffset, yOffset)  
{
	markers = markers || []
	mapCenterOffsetX = xOffset;
	mapCenterOffsetY = yOffset
	zoom = zoom || 14;

	var mapContainer = jQuery(map_id).get(0),
		pins = [];
	
	mapMarkers[map_id] = markers;

	//jQuery(mapContainer).hide();
	if(!geocoder)
	{
		geocoder = new google.maps.Geocoder();
	}

	
	var myOptions = {
	  zoom: zoom,
	  mapTypeId: 'roadmap',
	  panControl: true,
	  rotateControl: false,
	  scaleControl: false,
	  streetViewControl: false,
	  zoomControl: false,
	  mapTypeControl: false,
	  scrollwheel: false,
	  zoomControlOptions: {
		  position: google.maps.ControlPosition.RIGHT_CENTER
	  }
	}

	map[map_id] = new google.maps.Map(mapContainer, myOptions);

	if(styles != undefined) 
	{
		map[map_id].setOptions({styles: styles});
	}
	
	var bounds = function () {
		var b = new google.maps.LatLngBounds();
		pins.forEach(function(m) {
			b.extend(m.getPosition());
		});
		
		return b;
	}
	
	google.maps.event.addDomListener(window, 'resize', function() {  
		var center = map[map_id].getCenter();
			
		google.maps.event.trigger(map[map_id], "resize");
		map[map_id].setCenter(center);
		
	});
		
	google.maps.event.addListenerOnce(map[map_id], 'idle', function(){
		mapCenter(map_id, bounds(), zoom);
	});
	

	
	markers.forEach(function(marker) {
	
		if(marker.title !== null || marker.html !== null) {
			var contentString = '<div class="map-content">' + (marker.title?'<h3>'+marker.title+'</h3>':'') + (marker.html?'<p>'+marker.html+'</p>':'') +'</div>';
			var infowindow = new google.maps.InfoWindow({content: contentString});
		}
		
		var marker = GmapLatLng(map_id, marker.lat||0, marker.lng||0, marker.html||'', marker.image||null);
		pins.push(marker);
		
		if(infowindow != undefined) {
			if(markers.length == 1) {
				infowindow.open(map[map_id], marker);
			}
			marker.addListener('click', function() {
			  infowindow.open(map, marker);
			});

		}
		
	});
	
	
	//google.maps.event.trigger(map[map_id], "resize");
	//
	
}

function GmapLatLng(map_id, lat, lng, html, image) 
{
	
	if(!lat || !lng) return;
	
		var latlng = new google.maps.LatLng(lat, lng);
	
			
		 var marker = new google.maps.Marker({
											  position: latlng, 
											  map:  map[map_id],
											  icon: (image!=undefined)?image:null
										 }); 


		  var myOptions = {
				 content: html
				,disableAutoPan: false
				,maxWidth: 0
				,closeBoxURL: ""
				,zIndex: null

				,infoBoxClearance: new google.maps.Size(1, 1)
				,isHidden: false

				,enableEventPropagation: false
			};
	

	return marker;

}

function mapCenter(map_id, bounds, zoom) 
{
	
	map[map_id].setCenter(bounds.getCenter()); 
	map[map_id].fitBounds(bounds);
	
	if(mapMarkers[map_id].length == 1) {
		map[map_id].setZoom(zoom);
	} else {
		map[map_id].setZoom(map[map_id].getZoom() - 1);	
	}

	
	/*
	var point1 = map[map_id].getProjection().fromLatLngToPoint( latlng );
	var point2 = new google.maps.Point(
		( (typeof(mapCenterOffsetX) == 'number' ? mapCenterOffsetX : 0) / Math.pow(2, map[map_id].getZoom()) ) || 0,
		( (typeof(mapCenterOffsetY) == 'number' ? mapCenterOffsetY : 0) / Math.pow(2, map[map_id].getZoom()) ) || 0
	);  
	map[map_id].setCenter(map[map_id].getProjection().fromPointToLatLng(new google.maps.Point(
		point1.x - point2.x,
		point1.y + point2.y
	)));
	
	*/
}


