function displayMap(target, markers, zoom) 
{
	//var markers = [{ lat: lat, lng: lng, image: null, title: title, html: html,  image: '/wp-content/themes/irs/images/pin.png' }];
	/*
	var markers = [
		{ lat: 42.1474199, lng: 24.7695034, image: '/wp-content/themes/irs/images/pin.png', html: null},
		{ lat: 42.13726587, lng: 24.74870029, image: '/wp-content/themes/irs/images/pin.png', html: null},
		{ lat: 42.12922771, lng: 24.78103568, image: '/wp-content/themes/irs/images/pin.png', html: null}
		
	];
	*/
	initialize_Map(target, markers, (zoom || 16), null, 0, 0);
}

jQuery().ready(function()
{
	jQuery('[data-map]').each(function()
	{
		var data = jQuery(this).data(),
			lat = (data.lat || 0),
			lng = (data.lng || 0),
			id  = jQuery(this).attr('id'),
			title = jQuery(this).attr('title') || '',
			zoom = data.zoom || 16,
			html = data.html || '';
			
		if(!id) return;
		var latitude = [],
			longitude = [],
			titles = [],
			htmls = [],
			markers = [];
		
		//Latitude
		if(isNaN(lat)) {
			lat.split("|").forEach(function(l) {
				latitude.push(l);
			});
		} else {
			latitude.push(lat);
		}
		
		//Latitude
		if(isNaN(lng)) {
			lng.split("|").forEach(function(l) {
				longitude.push(l);
			});
		} else {
			longitude.push(lng);
		}
		
		//Latitude
		title.split("|").forEach(function(t) {
			titles.push(t);
		});
		
		//Latitude
		html.split("|").forEach(function(t) {
			htmls.push(t);
		});
		
		latitude.forEach(function(lat, i) {
			markers.push({ lat: parseFloat(lat), lng: parseFloat((longitude[i] || 0)), image: null, title: titles[i] || null, html: (htmls[i] || null),  image: '/wp-content/themes/irs/images/pin.png' });
		});
		
		console.log(markers);
		
		displayMap('#' + id, markers, zoom);
		
	});
});
